() => {
  action_login.run(() => {
    if (!action_login.data.error) {
      storeValue('cookie', action_login.responseMeta["headers"]["Set-Cookie"][0]);
      storeValue('login_data', action_login.data.result);
    } else {
      showAlert('Login failed!', 'error');
      storeValue('cookie', false);
      storeValue('login_data', false);
    }
  }, () => {});
}

